&lt;html&gt;
&lt;head&gt;
&lt;link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"&gt;
&lt;script&gt;
(function(skuid){
		navigator.sayswho= (function(){
            var ua= navigator.userAgent, tem, 
            M= ua.match(/(opera|chrome|safari|firefox|msie|trident(?=\/))\/?\s*(\d+)/i) || [];
            if(/trident/i.test(M[1])){
                tem=  /\brv[ :]+(\d+)/g.exec(ua) || [];
                return 'IE '+(tem[1] || '');
            }
            if(M[1]=== 'Chrome'){
                tem= ua.match(/\b(OPR|Edge)\/(\d+)/);
                if(tem!= null) return tem.slice(1).join(' ').replace('OPR', 'Opera');
            }
            M= M[2]? [M[1], M[2]]: [navigator.appName, navigator.appVersion, '-?'];
            if((tem= ua.match(/version\/(\d+)/i))!= null) M.splice(1, 1, tem[1]);
            return M.join(' ');
        })();
        console.log((navigator.sayswho).substr(0,(navigator.sayswho).indexOf(' ')));
        console.log((navigator.sayswho).substr((navigator.sayswho).indexOf(' ')+1));

        var browser = (navigator.sayswho).substr(0,(navigator.sayswho).indexOf(' '));
        var version = (navigator.sayswho).substr((navigator.sayswho).indexOf(' ')+1);
        if  (browser == 'MSIE' &amp;&amp; parseInt(version)&lt;11)
        {
            document.getElementById("div").innerHTML = "&lt;p&gt;&lt;strong&gt; The Customer Center does not support this browser. To continue using the system, you need to update your web browser or use a different one.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;You may want to try one of the following alternatives:&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;font color='#0099cc'&gt;&lt;i class='fa fa-edge' aria-hidden='true'&gt;&lt;/i&gt; Microsoft Edge (Windows only)&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;&lt;i class='fa fa-internet-explorer' aria-hidden='true'&gt;&lt;/i&gt; The latest version of Microsoft Internet Explorer (Internet Explorer 11 - Windows only)&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;&lt;i class='fa fa-chrome' aria-hidden='true'&gt;&lt;/i&gt; Google Chrome&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;&lt;i class='fa fa-firefox' aria-hidden='true'&gt;&lt;/i&gt; Mozilla Firefox&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;";
            //document.getElementById("div").style.padding = "30px";
            document.getElementById("sk-lY2-1094").style.padding = "30px";
        }
})(skuid);
&lt;/script&gt;
